import React from 'react';
import { Button } from '@mui/material';

const InputButton = (props) => {
  return (
    <Button
      type="submit"
      variant="contained"
      sx={{
        maxWidth: 'inherit',
        bgcolor: 'gray',
        marginTop: '30px',
        fontFamily: 'Montserrat',
        borderRadius: '20px',
      }}
    >
      {props.name}
    </Button>
  );
};

export default InputButton;
